<script setup>
import { onMounted, nextTick } from 'vue'
import { useNavigationStore } from '@/store/navigation'
const navigation = useNavigationStore()
// eslint-disable-next-line no-undef
const props = defineProps({
    isPhone: {
        type: Boolean
    }
})
onMounted(async () => {
    await nextTick()

    const text1 = document.querySelector('#text-field-1')
    const text2 = document.querySelector('#text-field-2')
    
    setTimeout(() => {
        text1.classList.add('visible')
    }, 1500)

    const next1 = text1.querySelector('#next_2')
    next1.addEventListener('click', () => {
        text2.classList.add('visible')
    })

    const next2 = text2.querySelector('#next')
    next2.addEventListener('click', () => {
        navigation.stepForward()
    })
    
})
</script>

<style lang="scss">
[id|=text-field] {
    opacity: 0;
}

#to-text {
    opacity: 0;
}

.visible {
    transition: all ease .5s;
    opacity: 1 !important;

    [id=next],
    [id^=next_] {
        cursor: pointer;
        opacity: 0.8;
        transition: all ease .2s;

        &:hover {
            opacity: 1;
        }
    }
}

#to-text:hover {
    opacity: 1;
    transition: all ease .2s;
    cursor: pointer;
}
</style>